import React, { useState } from 'react';
import { Nav, NavItem, Row ,Container, Col, NavLink } from 'reactstrap';

const Signup = (props) => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggle = () => setDropdownOpen(!dropdownOpen);

  return (
      <Container>
<div className="signup">
         
         <div className="row">
             <div className="col-md-4 col-sm-12  offset-4">
             <Nav tabs>
            <NavItem>
              <NavLink href="#" active>Step 1</NavLink>
            </NavItem>
            
            <NavItem>
              <NavLink href="#" >Step 2</NavLink>
            </NavItem>
          
           
          </Nav>
             </div>
             </div>          
           <div className="form">
              <form  className="fo">

              </form>
           </div>
        </div>
      </Container>
    
  );
}

export default Signup;
